import React from 'react';

import useStyles from './styles'


function Tag(props) {
    const classes = useStyles();

    return (
        <div className={classes.modalBox}>
            <img className={classes.img} src={props.img} />
            <h4>{props.name}</h4>
            <p>{props.title}</p>
            <h5>{props.price}</h5>
        </div>
     );
}

export default Tag;
